import React from "react";
import logo from "../logo.svg";

export class ImageSlider extends React.Component {
  state = {
    images: [
      "https://i.pinimg.com/564x/68/22/cb/6822cbc6d9b58828b2bf04dc8627fd51.jpg"
    ]
  };

  render() {
    return <div>image slider...</div>;
  }
}
